import { style } from "typestyle";

const HowItWorkStyle = style({
    position: 'relative',
    backgroundColor: 'white',
    margin: '250px 0',
    $nest: {
        '& .top-wave': {
            position: 'absolute',
            top: 0,
        }
    }
})

export default HowItWorkStyle
